import React from 'react';
import './navBar.css';
import { LinearTextGradient } from "react-native-text-gradient";

function NavBar (){
        return(
            <nav className='navbarItems'>
                <LinearTextGradient colors={['red', 'blue']}>
                <h1 className='navbar-logo'>
                Expert Republic
                </h1>
                </LinearTextGradient>
            </nav>
        );
    }

export default NavBar;
